                    <div class="info-text__content full-opacity has-list">

                      FDI (Fracture Driven Interaction) also known as frac hits, frac bashings, frac shadows or
                      poroelastic effects, is the subsurface phenomenon that negatively impacts the well production and
                      causes companies to miss both short and long-term production forecasts. <br/><br/>

                      FracSol FDI is the fastest and only comprehensive analytics tool for getting FDI insights. This
                      software automatically identifies, categorizes, highlights and extracts, fracture interaction
                      events in real-time. An appealing and user-friendly interface created for rich visualization and
                      effortless data interaction.<br/><br/>

                      FracSol FDI makes it faster and simpler to enhance understanding of SRV (Stimulated Rock Volume)
                      by utilizing automated production impairment analysis tool and find relationship between FDI
                      events.

                    </div>
